Job Description:
Our Company
Wecker Associates is a world class consulting firm helping Fortune 500 companies with sophisticated data, statistical and mathematical analyses for corporate decision making, research and development, and expert testimony in litigations. We are looking for the right individual to join our team in Jackson, WY.

General Purpose
Data Analysts and Consultants work closely with Project Managers and Senior Consultants to solve client problems.

Desirable Qualifications
M.S. or B.S. in quantitative field;
Strong computer and data analysis skills (we use SAS, S-plus, Mathematica, and other scientific and general business software in a UNIX environment);
Good communication skills;
Ability to work collaboratively in an informal, collegial environment;
Ability to work effectively under deadlines.

Compensation and Benefits
Compensation strongly competitive with business, government, and academia;
Company-sponsored health and dental coverage.

Position Description: Data Analyst

The mission of Success Academies is to reimagine public education. From the classroom to the halls of government, this means finding profoundly different approaches to how we structure, implement and support schooling. We reconceive every aspect of school design, from writing rigorous new curricula to drawing regularly on the advances in technology and business that are transforming every sector except education.

Over the past decade, Success Academies has grown faster than any charter network in the nation, building a vibrant network of 47 elementary, middle and high schools. Our ~16,000 children mostly poor and minority are out-performing students at top city and suburban schools across New York State. Our goals for our second decade are even more ambitious: to grow to 100 schools and to educate 50,000 children across New York City in a uniquely holistic pre-k-12 system, bringing transformational change here and across the country. At 100 schools, we will graduate 3,000 scholars each year who are prepared to enter, persist and graduate from college and eventually to lead in business, government and civic realms.

To further position the organization for this rapid growth, Success Academies must reimagine the way work is done across both the enterprise and our network of schools -- valorizing simplification, efficiency and effectiveness. To help the organization make these necessary shifts and radically improve enterprise-wide performance, Success Academies established the Success Edge Office to promote and facilitate the implementation of proven continuous improvement methods and tools, and thereby root out inefficiencies and wasteful work. Data & Analytics capability is needed to put in place a baseline of actionable management reporting that adheres to high reporting standards, generates standard and ad-hoc reporting, and performs meaningful analytics.

The Data Analyst reports to the Leader of Success Edge.


In this role, you will:
Monitor relevant Key Performance Indicators to track and measure outcomes and impact;
Apply the standard enterprise continuous improvement methodology to daily work;
Apply effective project and change management processes to drive radical improvements;
Monitor and manage metrics and reporting for EDGE Office, including daily, weekly and monthly reporting, data summaries, and trend analysis; and
Produce actionable data insights for our enterprise in the form of interactive dashboards and visualizations, ad hoc reports and analysis.
Continuously partner with Network and School-based staff to understand school and business data needs and translate those requirements into high-quality work.
The Data Analyst must work closely with a broad base of constituencies across Success Academies and will be expected to exhibit...
Teamwork and collaboration;
Strong communication skills with the ability to effectively communicate in both written and verbal forms;
Results orientation;
Influence skills in order to drive understanding and adoption;
An ease to challenge thinking and assumptions; and
An eagerness to learn and take feedback to grow and achieve full potential.

Job Description:
Analyze and interpret financial risk data for Beshton, its customers, and its partner companies using expertise in economics and statistics;
Develop software and mathematical tools to evaluate loan applications and risk management, design statistical methods and algorithms for use in tools;
Identify trends in financial data and risk factors for businesses, process large amounts of collected data and make use of increased data points to increase forecasting accuracy;
Design Artificial Intelligence and machine learning models, apply modeling to Beshton’s data analysis tools and services;
Evaluate the algorithms and methods in risk management software to validate results and verify the accuracy of calculations;
Present software deliverables to management and client companies, make changes to analysis tools based on software requirements;
Report analysis results using internal tools, provide statistical visualizations and in-depth reporting that translates data into business insight.
Requirement:
Minimum a Master’s Degree in Economics/Econometrics.
Apply send email to career@beshton.com

